import pyb, machinefrom pyb import Switch, LEDimport  math, sysimport micropythonmicropython.alloc_emergency_exception_buf(100)def tim_cb(t):  global toggle  if toggle==1:    toggle=0  else:    toggle=1      #print('callback')def int_cb(t):  print('Interrupt detected.')  led=pyb.LED(1)step=pyb.Pin('Y4', pyb.Pin.OUT_PP)reset=pyb.Pin('X2', pyb.Pin.OUT_PP)enable=pyb.Pin('X22', pyb.Pin.OUT_PP)dir=pyb.Pin('Y3', pyb.Pin.OUT_PP)interrupt= pyb.ExtInt(pyb.Pin('X1'), pyb.ExtInt.IRQ_FALLING, pyb.Pin.PULL_UP, int_cb)global toggletoggle=0print('Reset setting low.')reset.low()pyb.delay(500)print('Reset setting high.')reset.high()pyb.delay(500)print('Enable setting high.')enable.high()pyb.delay(500)print('Enable setting low.')enable.low()pyb.delay(500)print('Setting direction high.')dir.high()pyb.delay(500)tim=pyb.Timer(8)tim.init(freq=100)tim.callback(tim_cb)while 1:  if toggle:    step.high()    led.on()  else:    step.low()    led.off()  #pyb.delay(3)    